svg.script:
(function(){
  const svg = document.documentElement;
  const ttg = document.getElementById('tooltip');
  const ttb = document.getElementById('tt-bg');
  const ttt = document.getElementById('tt');

  function moveTT(evt, text){
    const pt = svg.createSVGPoint();
    pt.x = evt.clientX; pt.y = evt.clientY;
    const ctm = svg.getScreenCTM().inverse();
    const p = pt.matrixTransform(ctm);
    ttt.textContent = text;
    const bbox = ttt.getBBox();
    ttb.setAttribute('width', bbox.width + 16);
    ttb.setAttribute('height', bbox.height + 12);
    ttb.setAttribute('x', p.x + 12);
    ttb.setAttribute('y', p.y - 8 - bbox.height);
    ttt.setAttribute('x', p.x + 20);
    ttt.setAttribute('y', p.y - 8);
    ttg.setAttribute('visibility', 'visible');
  }
  function hideTT(){ ttg.setAttribute('visibility', 'hidden'); }
  Array.from(document.querySelectorAll('.lot')).forEach(n => {
    const name = n.getAttribute('data-name') || n.id;
    n.addEventListener('mousemove', e => moveTT(e, name));
    n.addEventListener('mouseleave', hideTT);
  });
})();
